//           }}
//           endIcon={<SendIcon />}
//         >
//           Send
//         </Button>
//       </Box>
//     </Stack>
//   );
// }
class App extends React.Component {
  constructor() {
    super();
    this.state = {
      count: 0,
      Values: [],
      textvalue: "none",
    };
    //this.Values = [];
    //this.textvalue = "text";
    this.Addvalue = this.Addvalue.bind(this);
    //const [textvalues, setState] = useState("");
  }

  increase(prop) {
    let floors = [...this.state.Values];

    // Add item to it
    floors.push({ prop });

    // Set state
    this.setState({ floors });
    //this.setState({ Values: Values.push(prop) });
  }
  Addvalue(evt) {
    //console.log(this.state.textvalue);
    evt.preventDefault();

    let tasks = this.state.Values;
    let textvalue = this.state.textvalue;
    tasks.push(textvalue);
    this.setState({ Values: tasks });
    //console.log(this.state.Values);
  }
  updateInput = (evt) => {
    this.setState({ textvalue: evt.target.value });
  };
  generate = (element = React.ReactElement) => {
    return [0, 1, 2].map((value) =>
      React.cloneElement(element, {
        key: value,
      })
    );
  };

  Demo = styled("div")(({ theme }) => ({
    backgroundColor: theme.palette.background.paper,
  }));
  render() {
    console.log(this.state.Values);
    return (
      <div style={{ margin: "50px" }}>
        <Stack direction="row" justifyContent="center">
          <Box
            component="div"
            sx={{
              "& > :not(style)": {
                m: 1,
                width: "50ch",
              },
              display: "contents",
            }}
            noValidate
            autoComplete="off"
          >
            <TextField
              id="standard-basic"
              label="Standard"
              variant="standard"
              onChange={this.updateInput}
              sx={{
                width: "80%",
              }}
            />

            <Button
              variant="contained"
              sx={{
                width: "92px !important",
              }}
              startIcon={<AddCircle />}
              onClick={this.Addvalue}
            >
              Add
            </Button>
          </Box>
        </Stack>
        <Stack direction="row" justifyContent="center">
          <Box
            component="div"
            sx={{
              "& > :not(style)": {
                m: 1,
                width: "50ch",
              },
              display: "contents",
            }}
            noValidate
            autoComplete="off"
          >
            <List
              sx={{
                width: "100%",
                maxWidth: 500,
                bgcolor: "background.paper",
                position: "relative",
                overflow: "auto",
                maxHeight: 300,
                "& ul": { padding: 0 },
              }}
              subheader={<li />}
            >
              <Demo>
                <List dense={dense}>
                  {generate(
                    <ListItem>
                      <ListItemText
                        primary="Single-line item"
                        secondary={secondary ? "Secondary text" : null}
                      />
                    </ListItem>
                  )}
                </List>
              </Demo>
              {/* {this.state.Values.length !== 0 ? (
                [this.state.Values].map((Values) => (
                  <li key={`section-${Values}`}>
                    <ul>
                      <ListItem key={`item-${Values}-${Values}`}>
                        <ListItemText primary={`${Values}`} />
                      </ListItem>
                    </ul>
                  </li>

                  // <li key={`section-${Values}`}>
                  //   <ul>
                  //     <ListSubheader>{` ${Values}`}</ListSubheader>
                  //     {[0, 1, 2].map((item) => (
                  //       <ListItem key={`item-${Values}-${item}`}>
                  //         <ListItemText primary={`Item ${item}`} />
                  //       </ListItem>
                  //     ))}
                  //   </ul>
                  // </li>
                ))
              ) : (
                <ListSubheader>No Data Available..</ListSubheader>
              )} */}
            </List>
          </Box>
        </Stack>
      </div>
    );
  }
}

export default App;
